import './userTile.css'
import more from './more-horizontal.svg'

const UserTile = () => {
    return (
        <>
            <div className='userTile'>
                <div className='user'></div>
                <div className='icons'>
                    <img src={more} alt='more' />
                </div>
            </div>
        </>
    );
}

export default UserTile;
